import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import {Typography} from "@material-ui/core";
import Container from "@material-ui/core/Container";
import {makeStyles} from "@material-ui/core/styles";
import profilePhoto from "../images/myPhotoBlackWhite.png"
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Box from "@material-ui/core/Box";

const useStyles = makeStyles((theme) => ({
    sectionWeb: {
        display: 'none',
        [theme.breakpoints.up('md')]: {
            display: 'flex',
        },
    },
    sectionMobile: {
        display: 'flex',
        width: '100%',
        [theme.breakpoints.up('md')]: {
            display: 'none',
        },
    },
    root: {
        display: 'flex',
        borderRadius: '0rem 0rem 3rem 3rem',

    },
    details: {
        display: 'flex',
        flexDirection: 'column',
    },
    content: {
        flex: '1 0 auto',
    },
    cover: {
        width: 250,
    },
}));

function App() {
    const classes = useStyles();

    return (
        <div>
            <ApplicationBar/>
            <Container className={classes.sectionWeb} style={{border: 'red solid 1px'}}>
                <div id="box1"></div>
                <div id="box2">
                    <div id="text">
                        <Typography variant="h1" noWrap>Hello,</Typography>
                        <Typography variant="h1" noWrap>I'm Latifa</Typography>
                    </div>
                </div>
            </Container>
            <Container className={classes.sectionMobile}>
                <Card display="flex" className={classes.root}>
                    <div className={classes.details}>
                        <CardContent className={classes.content}>
                            <Typography variant="h1">
                                Hello,
                            </Typography>
                            <Typography variant="h3" color="textSecondary">
                                I'm Latifa
                            </Typography>
                        </CardContent>
                    </div>
                    <CardMedia
                        className={classes.cover}
                        image={profilePhoto}
                        title="Live from space album cover"
                    />
                </Card>
            </Container>
            <div style={{ width: '100%' }}>
                <Box display="flex" p={1} bgcolor="background.paper">
                    {"I'm a flexbox container!"}
                </Box>
            </div>
        </div>
    );
}

export default App;


